        "    step = 1\n",
        "    mse_values = []\n",
        "\n",
        "    for k_knn in range(K_min, K_max + 1, step):\n",
        "        distance_matrix = cdist(X_val_norm, X_tr_norm, metric='euclidean')\n",
        "        nearest_indices = np.argsort(distance_matrix, axis=1)[:, :k_knn]\n",
        "        predictions = []\n",
        "        true_values = []\n",
        "\n",
        "        for i in range(X_val_norm.shape[0]):\n",
        "            A_knn = X_tr_norm[nearest_indices[i]]\n",
        "            y_knn = y_tr_norm[nearest_indices[i]]\n",
        "\n",
        "            if A_knn.shape[0] == 0: continue\n",
        "            if A_knn.shape[1] == 0: continue\n",
        "\n",
        "            I_knn = np.eye(A_knn.shape[1])\n",
        "            try:\n",
        "                w_hat_knn = np.linalg.inv(A_knn.T @ A_knn + epsilon * I_knn) @ A_knn.T @ y_knn\n",
        "            except np.linalg.LinAlgError:\n",
        "                w_hat_knn = np.linalg.pinv(A_knn.T @ A_knn + epsilon * I_knn) @ A_knn.T @ y_knn\n",
        "\n",
        "            x_val_point = X_val_norm[i]\n",
        "            y_hat_knn = x_val_point @ w_hat_knn\n",
        "            predictions.append(y_hat_knn)\n",
        "            true_values.append(y_val_norm[i])\n",
        "\n",
        "        predictions_np = np.array(predictions)\n",
        "        true_values_np = np.array(true_values)\n",
        "\n",
        "        if len(predictions_np) > 0:\n",
        "            mse_knn = np.mean((true_values_np - predictions_np) ** 2)\n",
        "            mse_values.append(mse_knn)\n",
        "            print(f\"MSE for K={k_knn}: {mse_knn:.4f}\")\n",
        "        else:\n",
        "            mse_values.append(np.inf)\n",
        "            print(f\"No predictions made for K={k_knn}, MSE set to infinity.\")\n",
        "\n",
        "    if mse_values:\n",
        "        plt.figure(figsize=(10, 6))\n",
        "        plt.plot(range(K_min, K_max + 1, step), mse_values, marker='o')\n",
        "        plt.xlabel('Number of Neighbors (K)')\n",
        "        plt.ylabel('Mean Square Error (MSE)')\n",
        "        plt.title('Validation MSE vs. K for KNN-like Ridge Regression')\n",
