        "\n",
        "        min_mse_index = np.argmin(mse_values)\n",
        "        optimal_k = K_min + min_mse_index * step\n",
        "        print(f\"\\nThe optimal K with the minimum validation MSE is: {optimal_k} (MSE: {mse_values[min_mse_index]:.4f})\")\n",
        "    else:\n",
