        "\n",
        "            I_test_knn = np.eye(A_test_knn.shape[1])\n",
        "            try:\n",
        "                 w_hat_test_knn = np.linalg.inv(A_test_knn.T @ A_test_knn + epsilon * I_test_knn) @ A_test_knn.T @ y_test_knn\n",
        "            except np.linalg.LinAlgError:\n",
