        "            actual_k = min(K_current, X_train_true_norm.shape[0])\n",
        "            nearest_indices = np.argsort(distances)[:actual_k]\n",
        "            A_local = X_train_true_norm[nearest_indices, :]\n",
        "            y_local = y_train_true_norm[nearest_indices]\n",
        "            if A_local.shape[0] == 0:\n",
        "                y_val_pred_knn_lls[i] = np.mean(y_train_true_norm); continue\n",
        "            w_hat_local = solve_lls_ridge(A_local, y_local, epsilon_ridge)\n",
        "            y_val_pred_knn_lls[i] = x_val_point @ w_hat_local\n",
